style.css:
@-moz-document domain("torrentgalaxy.to") {
ul.navbar-nav > li > a:hover,
    ul.navbar-nav > li > a:active {
        background-color: black;
        -ms-transform: scale(0.90);
        -webkit-transform: scale(0.90);
        transform: scale(0.90);
    }
    body {
        background-color: black;
    }
    nav.shadow {
        box-shadow: 0px 0px 0px 1px rgb(16 16 16);
    }
    #headnew {
        background: radial-gradient(ellipse at center, #212121 3%, #333333 70%);
    }
    input[type=text],
    input[type=password] {
        background-color: #655c8d;
        border: 3px black;
        color: black;
    }
    input[type=text].renamebox {
        border: 3px black;
    }
    #innerhead.tgxtablehead.int {
        background-color: #312957;
        color: #a79d9d;
    }
    .tgxtablerow {
        background-color: #111111;
    }
    .tgxtablerow:nth-of-type(2n+1) {
        background-color: #383838;
    }
    .tgxtablerow:hover {
        background-color: #222222;
    }
    .torrentpagetable > div:nth-of-type(2n+1) {
        background-color: #333333;
    }
    .torrentpagetable > div {
        background-color: #222222;
    }
    .breadcrumb,
    .form-control,
    .btn-default,
    .panel,
    .pagination > li > a,
    .pagination > li > span,
    .table-striped > tbody > tr:nth-of-type(2n+1),
    .chattersonline {
        background-color: #444444;
        color: gray;
    }
    img.profile {
        border-color: black;
    }
    div #panelmain.outer.panel-primary {
        background-color: #2f2f2f;
        color: #a6a1a1;
        border-color: black;
    }
    div #panelheader.panel-heading {
        background-color: #43581e;
        border-color: black;
    }
    div #intblock.panel-primary {
        background-color: #2f2f2f;
        border-color: black;
        color: #d1d1d1;
    }
    div #intblockheader.panel-heading {
        background-color: black;
        border: 1px black;
        color: whitesmoke;
    }
    div #inthpheader.panel-heading {
        background-color: #3f3b50;
        border: 1px black;
    }
    .panel {
        background-color: #444444;
    }
    .btn.btn-default {
        background-color: #5d5092;
        border-radius: 5px;
        color: #999999;
        border: 3px black;
        box-shadow: inset 0px 0px 0px 1px #725c5c;
    }
    .btn.btn-default:hover {
        background-color: black;
        -ms-transform: scale(0.90);
        -webkit-transform: scale(0.90);
        transform: scale(0.90);
    }
    .btn.btn-primary {
        background-color: #083e6c;
        color: whitesmoke;
    }
    .btn.btn-primary:hover {
        background-color: black;
        border-color: whitesmoke;
    }
    .btn.btn-success {
        background-color: #4b8612;
        color: black;
    }
    .btn.btn-success:hover {
        background-color: #4e9e00;
    }
    .buttonbox {
        background-color: black;
    }
    .btn.btn-dark {
        color: whitesmoke;
    }
    .btn.btn-dark:hover {
        background-color: #312957;
    }
    .btn-dark.focus,
    .btn-dark:focus {
        background-color: #212121;
    }
    .btn-default.highlightns {
        background-color: #674d1c;
    }
    .btn.btn-default.btn-sm.bbbox {
        margin: -2px -1px;
        padding: 5px 10px;
        border: 1px solid whitesmoke;
        background-color: #292929;
    }
    .btn.btn-default.btn-sm.bbbox:hover {
        background-color: #4c4c4c;
    }
    .btn.btn-default.btn-sm.bbbox:focus {
        color: #efc800;
    }
    .btn.btn-danger {
        background-color: #a80404;
        color: black;
    }
    .btn.btn-danger:hover {
        background-color: #eb0b0b;
    }
    .btn.btn-warning {
        background-color: #985708;
        color: #d2d1d1;
    }
    .btn.btn-warning:hover {
        background-color: #b56706;
    }
    .btn.btn-info {
        background-color: #406280;
        color: #b7b7b7;
    }
    .btn.btn-info:hover {
        background-color: #30495f;
    }
    .btn.btn-info2 {
        background-color: #265458;
        color: #a9a9a9;
    }
    .btn.btn-info2:hover {
        background-color: #1f474a;
    }
    .btn.btn-info3 {
        background-color: #545454;
        color: #b7b7b7;
    }
    .btn.btn-info3:hover {
        background-color: #444343;
    }
    .label.indexlabel {
        background-color: #28669a;
        box-shadow: 0px 0px 5px black;
        text-shadow: 1px 1px 5px #0cc20c;
        color: #ccc9c9;
    }
    .label.label-default {
        background-color: #4c4c4c;
        color: #c3c3c3;
    }
    .label.label-success {
        background-color: #4b9702;
        border-color: black;
        color: #d0af03;
    }
    .label.label-warning {
        background-color: #af6104;
        color: #a6a1a1;
    }
    .label.label-danger {
        background-color: #c60404;
        color: #deba00;
    }
    .ubuntu.panel-title {
        color: #cdc3b5;
        font-weight: bold;
    }
    select {
        background-color: #444444;
        color: #c3c3c3;
        border: 1px solid #7f7d7d;
    }
    div #filterbox {
        background-color: #5e5582;
        border: 1px outset #716e6e;
        border-color: black;
    }
    div #filterbox:hover {
        background-color: #313131;
    }
    div #filterbox2 {
        background-color: #353535;
        border: 2px dotted black;
    }
    div #filterbox2:hover {
        background-color: #313131;
    }
    .pagination > .active > a,
    .pagination > .active > a:focus,
    .pagination > .active > a:hover,
    .pagination > .active > span,
    .pagination > .active > span:focus,
    .pagination > .active > span:hover {
        background-color: #196587;
        border: 1px black;
        color: #9a9393;
        border-color: black;
        box-shadow: inset 0px 0px 0px 1px #9a7e7e;
    }
    .pagination > .disabled > a,
    .pagination > .disabled > a:focus,
    .pagination > .disabled > a:hover,
    .pagination > .disabled > span,
    .pagination > .disabled > span:focus,
    .pagination > .disabled > span:hover {
        background-color: #4e4963;
        border: 1px black;
        color: #7c7a7a;
        border-color: black;
        box-shadow: inset 0px 0px 0px 1px #857070;
    }
    .pagination > li > a,
    .pagination > li > span {
        background-color: #4e4963;
        border: 1px black;
        border-color: black;
        box-shadow: inset 0px 0px 0px 1px #725c5c;
        color: #5d87ab;
    }
    .pagination > li > a:hover {
        background-color: whitesmoke;
        -ms-transform: scale(0.93);
        -webkit-transform: scale(0.93);
        transform: scale(0.93);
    }
    div a {
        color: #5d87ab;
    }
    legend {
        color: #adadad;
        border-bottom: 1px solid black;
    }
    div .alert-info {
        background-color: #5782a9;
        border-color: black;
        color: #bdbdbd;
    }
    div .ulert-info {
        background-color: #5782a9;
        border-color: black;
        color: #bdbdbd;
    }
    div .ullert-info {
        background-color: #5782a9;
        border-color: black;
        color: #bdbdbd;
    }
    #blockalert.alert-info {
        color: #99cde6;
        background-color: #303a40;
        border-color: black;
    }
    #blockalert.ulert-info {
        color: #99cde6;
        background-color: #303a40;
        border-color: black;
    }
    #blockalert.ullert-info {
        color: #99cde6;
        background-color: #303a40;
        border-color: black;
    }
    div .alert-warning {
        color: #b9b9b9;
        background-color: #5f4f00;
        border-color: black;
    }
    div .ulert-warning {
        color: #b9b9b9;
        background-color: #5f4f00;
        border-color: black;
    }
    div .ullert-warning {
        color: #b9b9b9;
        background-color: #5f4f00;
        border-color: black;
    }
    div #plain.alert-info {
        background-color: #5782a9;
        border-color: black;
        padding: 6px;
        box-shadow: 0px 0px 10px 0px rgb(0 0 0 / 12%);
        color: #bdbdbd;
    }
    div #plain.ulert-info {
        background-color: #5782a9;
        border-color: black;
        padding: 6px;
        box-shadow: 0px 0px 10px 0px rgb(0 0 0 / 12%);
        color: #bdbdbd;
    }
    div #plain.ullert-info {
        background-color: #5782a9;
        border-color: black;
        padding: 6px;
        box-shadow: 0px 0px 10px 0px rgb(0 0 0 / 12%);
        color: #bdbdbd;
    }
    a#plain.btn {
        background-color: #909ba6;
    }
    div .highlight {
        background-color: rgb(183 169 0 / 16%);
    }
    div .rounded {
        border-radius: 5px;
    }
    .fpboxheader {
        background-color: #3f3b50;
    }
    .badge {
        color: #b5b1b1;
        background-color: #4c4c4c;
    }
    .badge.badge-secondary {
        background-color: #4c4c4c;
        color: #b1afaf;
    }
    #nonzero.badge.badge-secondary {
        color: #ffd700;
    }
    .bg-info {
        background-color: #576d77;
    }
    .bginfo {
        background-color: #5782a9;
    }
    .bg-success {
        background-color: #214a2c;
    }
    .bg-danger {
        background-color: #460000;
    }
    .alert-success {
        color: #77e879;
        background-color: #214a2c;
        border: 1px black;
    }
    .ulert-success {
        color: #77e879;
        background-color: #214a2c;
        border: 1px black;
    }
    .ullert-success {
        color: #77e879;
        background-color: #214a2c;
        border: 1px black;
    }
    .alert-danger {
        color: #ef6461;
        background-color: #502424;
        border: 1px black;
    }
    .ulert-danger {
        color: #db130f;
        background-color: #502424;
        border: 1px black;
    }
    .ullert-danger {
        color: #ef6461;
        background-color: #502424;
        border: 1px black;
    }
    hr {
        border-top: 1px solid black;
    }
    textarea.mail,
    input.def {
        border: 1px black;
        background-color: #5b5163;
        color: #d1d1d1;
        font-family: monospace;
    }
    textarea.mail#ghosted {
        background-color: #424242;
    }
    #emojibar {
        padding-bottom: 2px;
        background-color: #4f3b5e;
    }
    .badge.badge-light.commentsbadge {
        background-color: #636363;
    }
    .commenthead {
        padding: 5px 10px 5px 40px;
        border-radius: 5px;
    }
    #usercomment.commenthead {
        background-color: #383838;
    }
    #anoncomment.commenthead {
        background-color: #403842;
    }
    #guestcomment.btn.btn-info {
        background-color: #6e236f;
        border: 1px black;
    }
    #guestcomment.btn.btn-info:hover {
        background-color: #a938ab;
    }
    div .torrentwidget {
        background-color: #403f3f;
        box-shadow: 0px 0px 0px 1px rgb(16 16 16);
    }
    div.torrentwidgetdlbox {
        background-color: #272727;
    }
    .forumhead {
        background-color: #383838;
        border: 1px black;
        color: #999999;
    }
    .subforumhead {
        background-color: #232222;
    }
    .table-striped > tbody > tr:nth-of-type(2n+1) {
        background-color: #333333;
    }
    .table-striped.table-hover > tbody > tr:hover {
        background-color: #312957;
    }
    #zerocomms.badge.badge-light.commentsbadge {
        color: black;
    }
    #nonzerocomms.badge.badge-light.commentsbadge {
        color: #d3b304;
    }
    #nonzeroposts.btn.viewunread {
        color: black;
    }
    #nonzeroposts.btn.viewunread:hover {
        background-color: #312957;
        color: whitesmoke;
    }
    span.username.user {
        color: #a49f9f;
    }
    span.username.trusted-user {
        color: #948c0a;
    }
    span.username.trial-uploader {
        color: #908f8f;
    }
    span.username.verified-uploader {
        color: #1eb60b;
    }
    span.username.trusted-uploader {
        color: #b9c719;
    }
    span.username.torrent-officer {
        color: #ff9200;
    }
    span.username.moderator {
        color: #fe0a04;
    }
    span.username.admin {
        color: #ddad06;
    }
    span.username.super-admin {
        color: blue;
    }
    span.username.tgx-exec {
        color: black;
        text-shadow: 0 0 10px whitesmoke;
    }
    h3 > i.headericon {
        color: #eda41e;
    }
    select.styled {
        background-color: #444444;
        color: #9a8686;
    }
    .btn.forumsearch {
        border-radius: 0px 5px 5px 0px;
        border: 1px solid black;
    }
    ul.dropdown-menu {
        background-color: #292929;
    }
    ul.dropdown-menu a {
        color: #878789;
    }
    ul.dropdown-menu li a:hover {
        background-color: #333333;
    }
    .ffbutton {
        color: #adadad;
    }
    .btn.leftbtn {
        border-radius: 5px 0px 0px 5px;
        border: 1px solid black;
    }
    #quotes {
        border: 2px solid black;
        background-color: #464646;
    }
    div .tagtext {
        color: #bdbdbd;
        padding: 3px 10px 0px 15px;
        font-weight: 900;
    }
    ul.nav-tabs {
        border-bottom: 1px solid black;
    }
    .tabs > li.active > a {
        background-color: #948000;
        border: 1px solid black;
        color: black;
    }
    .tabs > li.active > a:hover,
    .tabs > li.active > a:focus {
        background-color: #6d5e03;
        border: 1px solid black;
        color: #e2c300;
    }
    .tabs > li > a:hover,
    .tabs > li > a:focus {
        background-color: #5d5000;
        border: 1px solid black;
        color: #e2c300;
    }
    td.hotlist.userpickitems {
        background-color: #292929;
        border: 10px solid black;
        padding: 3px;
    }
    table.statusrank td {
        border-color: black;
    }
    .ucadminlist {
        background-color: #383838;
    }
    #ucastatus.ucadminlist {
        background-color: #383838;
    }
    div.newtablerow.header.int {
        background-color: #3f3b50;
    }
    .newtablerow.int {
        background-color: #3f3b50;
        color: whitesmoke;
    }
    .newtablerow {
        background-color: #292929;
    }
    .newtablerow:nth-of-type(2n+1) {
        background-color: #38333c;
    }
    .newtablerow:hover {
        background-color: #4e4e40;
    }
    .tagbox {
        border-radius: 6px;
        background-color: #d9edf7;
        width: 100%;
        padding: 3px;
        resize: none;
    }
    div .tagtext {
        color: #c2bebe;
    }
    .namebadge {
        background: none;
        background-color: #1d1d1d;
        border-color: black;
    }
    .namebadge:hover,
    .namebadge:active,
    .namebadge:focus {
        background: none;
        background-color: #454444;
        border-color: black;
    }
    .chattersonline {
        background-color: #484848;
    }
    .chatbox {
        box-shadow: inset 0px 0px 20px 10px rgb(72 72 72);
        background-color: #383838;
    }
    .radiospinner {
        color: #576879;
    }
    .radiobox {
        background-color: #383838;
    }
    .chatoptions {
        border: 1px solid black;
        border-radius: 5px;
    }
    #ddnews {
        background-color: #2f2f2f;
    }
    #ddnews:nth-of-type(2n+1) {
        background-color: #383838;
    }
    .thumbnail {
        background-color: #383838;
        border: 2px dashed black;
    }
    .thumbnail .caption {
        color: whitesmoke;
    }
    .caption.arcade {
        color: whitesmoke;
    }
    div #arcade.jumbotron {
        box-shadow: 0 0 15px 9px rgb(47 47 47) inset;
        background-color: #666666;
    }
    .form-control[disabled] {
        background-color: #333131;
        color: #028802;
        font-family: monospace;
    }
    .chatcelltimes.highlightct {
        background-color: #d2d2d2;
    }
    div.ubposttable > div.tprow,
    div.ubreplytable > div.tprow,
    div.ubstickytable > div.tprow {
        background-color: #505050;
    }
    div.ubposttable > div.tprow:nth-of-type(2n+1),
    div.ubreplytable > div.tprow:nth-of-type(2n+1),
    div.ubstickytable > div.tprow:nth-of-type(2n+1) {
        background-color: #404040;
    }
    li.mainmenu > a:hover,
    li.mainmenu > a:focus {
        background-color: #383838;
        color: #ffd700;
    }
    a.logins:hover,
    a.logins:focus {
        background-color: #383838;
        color: #ffd700;
    }
    blockquote {
        border-left: 5px solid #212121;
    }
    .likeboxtr {
        background-color: #3b3f42;
    }
    .tdmoderated {
        background-color: #352222;
        box-shadow: 0 0 20px 14px #634040;
    }
    #imdbttdhead {
        background-color: #272626;
    }
    .imdbttdsubhead {
        background-color: #444444;
    }
    .commpending {
        background-color: blue;
    }
    #torcolor {
        background-color: #004f94;
    }
    #newscolor {
        background-color: #68780a;
    }
    .commtd {
        background-color: #23282d;
    }
    .commtdfoot {
        background-color: #1d1d1a;
    }
    .table.commstable > tbody > tr > td {
        border-top: 1px;
    }
    dl > #chatcoldd:nth-of-type(2n+1) {
        background-color: #3e3d3d;
    }
    dl {
        background-color: #2f2f2f;
    }
    .vipclass {
        color: #efa706 !important;
    }
    .bannedclass {
        color: red !important;
    }
    .blockedclass {
        color: red !important;
    }
    .boobclass {
        color: pink !important;
    }
    #intblock.panel-primary.previewbox {
        background-color: #463c4d;
        border-color: black;
    }
    #intblockheader.panel-heading.previewbox {
        background-color: whitesmoke;
        border: 1px black;
    }
    .newsflash {
        color: #f4a460;
    }
    .usertablerow > td {
        border-top: 1px solid black;
    }
    .highlightrow:hover {
