        text-shadow: 0px 0px 4px #212121;
    }
    #quicksearchgroup #tt-footer,
    #quicksearchgroup #tt-footer {
        background-color: #9e903e;
        color: black;
    }
    #quicksearchgroup .tt-cursor,
    #quicksearchgroup .tt-cursor {
        background-color: #d3be46;
        box-shadow: inset 0px 0px 0px 1px #262b25;
    }
    table.forumsearch tr td {
        background-color: #c2bfbf;
    }
    .hltext {
        color: #d48d08;
    }
    .well {
        background-color: #242424;
        color: white;
    }
    .votebutton {
        color: #ffd700;
    }
}
